import axios from "axios";

const API_URL = "/api/company"; // Замените на URL вашего сервера

const companyAPI = {
  searchCompanies: async (name, taxId, registrationNumber) => {
    try {
      const response = await axios.post(`${API_URL}/searchCompanies`, {
        name,
        tax_id: taxId,
        government_registration_number: registrationNumber,
      });
      return response.data;
    } catch (error) {
      console.log("Ошибка при поиске компаний:", error);
      throw error;
    }
  },

  getObjCards: async (companyId, identifiers) => {
    try {
      const response = await axios.post(`${API_URL}/getObjCards`, {
        companies_id: companyId,
        identifiers,
      });
      return response.data;
    } catch (error) {
      console.log("Ошибка при получении карточек объектов:", error);
      throw error;
    }
  },
};

export default companyAPI;
